mittelqualität\r\n- Rutschfest\r\n- Flexibel\r\n- Einfache Reinigung\r\n- Spülmaschinenfest'),(262,4,83,0,52,NULL),(263,4,106,0,52,NULL),(264,4,146,0,52,'0'),(265,4,72,0,53,NULL),(266,4,73,0,53,'Praktisches dreiteiliges Reise-Set für:\r\n• längere Autofahrten\r\n• Fahrradtouren\r\n• Wanderungen\r\nDas Set besteht aus:\r\n• durchsichtigem Futterbehälter mit Schraubverschluss und Griff\r\n• zwei Kunststoffnäpfen für Futter und Wasser\r\nPlatzsparend können diese drei Teile ineinander gesteckt und mit einem Griff getragen werden.\r\nFassungsvermögen ca.: Futterbehälter 1600 ml, Näpfe je 600 ml.'),(267,4,83,0,53,NULL),(268,4,106,0,53,NULL),(269,4,146,0,53,'0'),(270,4,72,0,54,NULL),(271,4,73,0,54,'Snack Dummy No Limit - Apportieren leicht gemacht! Durch die Beschichtung mit original Teflon® ist diese Tasche unempfindlich gegen Nässe und Schmutz. Sie kann mit Snacks oder Trockenfutter befüllt werden und eignet sich ideal für die Erziehung und Ausbildung. Der Hund wird positiv motiviert, wenn er nach erfolgreichem Bringen sein Leckerchen aus der Tasche erhält. Es gibt keine Verletzungsgefahr, da der Reißverschluss verdeckt eingearbeitet ist. Die Tasche ist abwaschbar.\r\nTeflon® ist eine Marke von DuPont, die unter Lizenz von KARLIE Heimtierbedarf GmbH genutzt wird.'),(272,4,83,0,54,NULL),(273,4,106,0,54,NULL),(274,4,146,0,54,'0'),(275,4,72,0,55,NULL),(276,4,73,0,55,'Mit Anti-Rutsch-Gummiring (abnehmbar). Pflegeleicht. Farbe: schwarz.'),(277,4,83,0,55,NULL),(278,4,106,0,55,NULL),(279,4,146,0,55,'0'),(280,4,72,0,56,NULL),(281,4,73,0,56,'Mit Anti-Rutsch-Gummiring (abnehmbar). Pflegeleicht. Farbe: schwarz.'),(282,4,83,0,56,NULL),(283,4,106,0,56,NULL),(284,4,146,0,56,'0'),(285,4,72,0,57,NULL),(286,4,73,0,57,'Euer Hund schlingt seine Mahlzeiten in wenigen Sekunden herunter? Mit dem neuen interaktiven Fressnapf GREEN by NORTHMATE ® frisst euer Hund deutlich langsamer und hat auch noch Spaß dabei! Der Fressnapf ist einem Grasbüschel nachempfunden und verwandelt jede Mahlzeit in ein herausforderndes Spiel. GREEN by NORTHMATE ® besteht aus Hartkunststoff (ohne Phthalate) und kann somit auch im Freien genutzt – und im Geschirrspüler gereinigt werden. \r\n\r\nZur Nass- und Trockenfütterung geeignet.\r\n\r\nGREEN by NORTHMATE ®  gibt es auch für größere Hunde!'),(287,4,83,0,57,NULL),(288,4,106,0,57,NULL),(289,4,146,0,57,'0'),(290,4,72,0,58,NULL),(291,4,73,0,58,'Euer Hund schlingt seine Mahlzeiten in wenigen Sekunden herunter? Mit dem neuen interaktiven Fressnapf GREEN by NORTHMATE ® frisst euer Hund deutlich langsamer und hat auch noch Spaß dabei! Der Fressnapf ist einem Grasbüschel nachempfunden und verwandelt jede Mahlzeit in ein herausforderndes Spiel. GREEN by NORTHMATE ® besteht aus Hartkunststoff (ohne Phthalate) und kann somit auch im Freien genutzt – und im Geschirrspüler gereinigt werden. \r\nZur Nass- und Trockenfütterung geeignet.\r\nGREEN by NORTHMATE ®  gibt es jetzt auch im Mini-Format, für kleine Hunde!'),(292,4,83,0,58,NULL),(293,4,106,0,58,NULL),(294,4,146,0,58,'0'),(295,4,72,0,59,NULL),(296,4,73,0,59,'Bestens geeignet für Zieh- und Zerrspiele ist dieses bunte, stabile Baumwolltau mit Knoten. Beim Spielen werden auch gleichzeitig die Zähne gepflegt.'),(297,4,83,0,59,NULL),(298,4,106,0,59,NULL),(299,4,146,0,59,'0'),(300,4,72,0,60,NULL),(301,4,73,0,60,'Das Spiel mit Frisbees ist eine aktionsreiche und aufregende Freizeitbeschäftigung für bewegungsfreudige Hunde und deren genauso sportliche Herrchen. Neben Distanzwürfen gibt es unzählige Wurftechniken, die das Spiel immer wieder abwechslungsreich gestalten. Frisbee spielen kann man eigentlich mit jedem Hund. Der Hund sollte allerdings ausgewachsen und gesund sein. Diese Frisbee Scheibe besteht aus neonfarbigem Nylon und ist schön leicht.'),(302,4,83,0,60,NULL),(303,4,106,0,60,NULL),(304,4,146,0,60,'0'),(305,4,72,0,61,NULL),(306,4,73,0,61,'Für schwimmbegeisterte Vierbeiner! Das ideale Wasserspielzeug aus softweichem, hochwertigem Neopren. Der Aquaball ist schwimmfähig und gut zu greifen durch die Baumwollseile. Die schwarz-gelbe Farbe ist im Wasser gut zu sehen. Und ist der Ball mal schmutzig, kann er bei 30 °C gewaschen werden.'),(307,4,83,0,61,NULL),(308,4,106,0,61,NULL),(309,4,146,0,61,'0'),(310,4,72,0,62,NULL),(311,4,73,0,62,'Mit dem Boomer Vollgummi Aqua Football bieten Sie Ihrem Hund stundenlangen Spielspaß im und am Wasser. Mit Hilfe der Kordel lässt sich der Football super werfen. Der Ball ist schwimmfähig und die Farbe orange ist im Wasser besonders gut sichtbar. Ideal zum Apportieren, Trainieren und Ausbilden. Massiert und pflegt \"spielend\" Gebiss und Zähne. Mit Vanille-Aroma.'),(312,4,83,0,62,NULL),(313,4,106,0,62,NULL),(314,4,146,0,62,'0'),(315,4,72,0,63,NULL),(316,4,73,0,63,'Für besonders viel Spaß am und im Wasser sorgt der schwimmfähige Boomer Aqua Ring aus natürlichem Vollgummi. Nebenbei werden Gebiss und Zähne \"spielend\" massiert und gepflegt. Ideal auch zum Apportieren, Trainieren und Ausbilden. Durch die orange Farbe besonders gut sichtbar im Wasser. Mit Vanille-Aroma.'),(317,4,83,0,63,NULL),(318,4,106,0,63,NULL),(319,4,146,0,63,'0'),(320,4,72,0,64,NULL),(321,4,73,0,64,'Bieten Sie Ihrem Hund Abwechslung und Bewegung mit diesem Spielzeug. Kleiner weicher Fußball aus Moosgummi in schwarz-weiß.'),(322,4,83,0,64,NULL),(323,4,106,0,64,NULL),(324,4,146,0,64,'0'),(325,4,72,0,65,NULL),(326,4,73,0,65,'Soft-Kunststoff.\r\nSchnell und einfach vom Boden zu fassen!\r\nTolle Flugweiten. Ideal auch für Welpen.'),(327,4,83,0,65,NULL),(328,4,106,0,65,NULL),(329,4,146,0,65,'0'),(330,4,72,0,66,NULL),(331,4,73,0,66,'Pfeifen unterstützen ein neutrales Training, da Emotionen nicht über eine Pfeife übertragen werden. Metallpfeifen gibt es in verschiedenen Ausführungen: als Hochfrequenzpfeife oder Trillerpfeife. In der Ausbildung von Hunden sehr beliebt sind Hochfrequenzpfeifen. Für den Hund sind hohe Frequenzen wesentlich besser zu hören als für den Menschen. Auch ist ein Ton aus dieser Pfeife immer ein eindeutiges Signal, anders als bei einer Stimme, die immer wieder anders klingt. Ein weiterer Vorteil für den Einsatz dieser Pfeife besteht darin, dass die Umgebung nur wenig gestört wird. Die Frequenz ist einstellbar. Robuste Metallausführung.'),(332,4,83,0,66,NULL),(333,4,106,0,66,NULL),(334,4,146,0,66,'0'),(335,4,72,0,67,NULL),(336,4,73,0,67,'Pfeifen unterstützen ein neutrales Training, da Emotionen nicht über eine Pfeife übertragen werden. Metallpfeifen gibt es in verschiedenen Ausführungen: als Hochfrequenzpfeife oder Trillerpfeife. In der Ausbildung von Hunden sehr beliebt sind Hochfrequenzpfeifen. Für den Hund sind hohe Frequenzen wesentlich besser zu hören als für den Menschen. Auch ist ein Ton aus dieser Pfeife immer ein eindeutiges Signal, anders als bei einer Stimme, die immer wieder anders klingt. Ein weiterer Vorteil für den Einsatz dieser Pfeife besteht darin, dass die Umgebung nur wenig gestört wird. Die Frequenz ist einstellbar. Robuste Metallausführung.'),(337,4,83,0,67,NULL),(338,4,106,0,67,NULL),(339,4,146,0,67,'0'),(340,4,72,0,68,NULL),(341,4,73,0,68,'Wunderschöne, kuschelige Wendedecke. Waschbar bei 30 °C.'),(342,4,83,0,68,NULL),(343,4,106,0,68,NULL),(344,4,146,0,68,'0'),(345,4,72,0,69,NULL),(346,4,73,0,69,'- Ovale Form\r\n- Kratzfest durch langlebiges Polyurethan\r\n- Geruchlos und atmungsaktiv\r\n- Wasserfest und temperaturbeständig\r\n- Bezug durch Reißverschluss abtrennbar und waschbar bei 40°\r\n- Mit aufgesticktem Motiv\r\n\r\nStraßenhunde- und Katzen in Montenegro-\r\nHelft uns zu helfen!\r\nTausende Touristen reisen jährlich in das kleine Land Montenegro. Leider sind hier die Lebensbedingungen für Hunde und Katzen katastrophal. Krank, schwach, abgemagert und hilflos liegen sie am Straßenrand, auf Plätzen, vor Cafés und Restaurants. Als erster und bisher einziger Tierschutzverein in Montenegro engagiert sich der Tierhilfe Montenegro e.V. für ein besseres Leben der dort lebenden Tiere. Karlie Flamingo schätzt die tägliche Arbeit des Vereins sehr und hilft unter anderem mit Sachspenden mit, das Leben der Hunde und Katzen lebenswerter zu machen.\r\nUm vor allem eine nachhaltige Hilfe vor Ort zu gewährleisten, wurde in Kooperation mit der Zeitschrift „Ein Herz für Tiere“ die eigens produzierte „Montenegro-Kollektion“ von Karlie Flamingo, bestehend aus Halsbändern, Betten, Kissen und Näpfen, kreiert. Von jedem verkauften Artikel der Kollektion kommt ein Euro dem Verein und der von ihm betreuten Tiere zugute. Zusätzlich erhält jeder Abonnent von „Ein Herz für Tiere“ als Prämie ein Hundehalsband aus der farbenfrohen Kollektion. '),(347,4,83,0,69,NULL),(348,4,106,0,69,NULL),(349,4,146,0,69,'0'),(350,4,72,0,70,NULL),(351,4,73,0,70,'- Ovale Form\r\n- Kratzfest durch langlebiges Polyurethan\r\n- Geruchlos und atmungsaktiv\r\n- Wasserfest und temperaturbeständig\r\n- Bezug durch Reißverschluss abtrennbar und waschbar bei 40°\r\n- Mit aufgesticktem Motiv\r\n\r\nStraßenhunde- und Katzen in Montenegro-\r\nHelft uns zu helfen!\r\nTausende Touristen reisen jährlich in das kleine Land Montenegro. Leider sind hier die Lebensbedingungen für Hunde und Katzen katastrophal. Krank, schwach, abgemagert und hilflos liegen sie am Straßenrand, auf Plätzen, vor Cafés und Restaurants. Als erster und bisher einziger Tierschutzverein in Montenegro engagiert sich der Tierhilfe Montenegro e.V. für ein besseres Leben der dort lebenden Tiere. Karlie Flamingo schätzt die tägliche Arbeit des Vereins sehr und hilft unter anderem mit Sachspenden mit, das Leben der Hunde und Katzen lebenswerter zu machen.\r\nUm vor allem eine nachhaltige Hilfe vor Ort zu gewährleisten, wurde in Kooperation mit der Zeitschrift „Ein Herz für Tiere“ die eigens produzierte „Montenegro-Kollektion“ von Karlie Flamingo, bestehend aus Halsbändern, Betten, Kissen und Näpfen, kreiert. Von jedem verkauften Artikel der Kollektion kommt ein Euro dem Verein und der von ihm betreuten Tiere zugute. Zusätzlich erhält jeder Abonnent von „Ein Herz für Tiere“ als Prämie ein Hundehalsband aus der farbenfrohen Kollek