Tiere“ die eigens produzierte „Montenegro-Kollektion“ von Karlie Flamingo, bestehend aus Halsbändern, Betten, Kissen und Näpfen, kreiert. Von jedem verkauften Artikel der Kollektion kommt ein Euro dem Verein und der von ihm betreuten Tiere zugute. Zusätzlich erhält jeder Abonnent von „Ein Herz für Tiere“ als Prämie ein Hundehalsband aus der farbenfrohen Kollektion. '),(422,4,83,0,84,NULL),(423,4,106,0,84,NULL),(424,4,146,0,84,'0'),(425,4,72,0,85,NULL),(426,4,73,0,85,'- Sichtbar bis ca. 500m \r\n- Aufladbarer Akku über USB-Kabel (z.B. am Computer) \r\n- Keine Batterien mehr nötig \r\n- Schlauch besteht aus flexiblem, weichem Silikon \r\n- Wasserfest \r\n- Temperaturbeständig \r\n- Blink- und Dauerlicht einstellbar \r\n- Leuchtdauer bei Blinklicht beträgt ca. 2 Stunden, bei Dauerlicht ca. 1,5 Stunden \r\n- Universell kürzbar, Einheitsgröße \r\n- Für Halsweiten von 20-75cm geeignet \r\n- CE geprüft \r\n- Mit USB-Kabel \r\n- Ladezeit beträgt ca. 1,5 bis 2 Stunden \r\n- Erhältlich in den Farben Orange, Grün, Weiß und Schwarz\r\n\r\nBringt Licht ins Dunkel – Mit dem prämierten Karlie Flamingo Visio Light LED-Halsband kann der fürsorgliche Hundebesitzer beim Gassi gehen nun effektiv für die Sicherheit seines geliebten Vierbeiners sorgen. Das neue LED-Halsband sorgt nämlich in drei unterschiedlichen \r\nEinstellungen zwischen Blink- und Dauerlicht dafür, dass der beste Freund des Menschen auf bis zu 500 Meter nicht mehr zu übersehen ist. \r\n\r\nBunt wie der Herbst \r\n\r\nDas Halsband ist für Hunde äußerst angenehm zu tragen, da der Schlauch, im Gegensatz zu vielen anderen Leuchthalsbändern, nicht aus Gummi, sondern aus flexiblem und weichem Silikon besteht. Dieses ist zudem wasserfest und äußerst temperaturbeständig und somit auch für Spaziergänge bei regnerischem Herbstwetter optimal geeignet. Passend zur Farbvielfalt des Herbstes ist das Visio Light in frischem Orange und seit neuestem auch in den Farben Grün, Weiß und Schwarz erhältlich.\r\n\r\nUniversell kürzbar für alle Hundegrößen \r\n\r\n Besonders praktisch: Das Visio Light gibt es in einer Einheitsgröße und ist dabei für alle Halsweiten von 20 bis 75 Zentimeter geeignet, da es sich ganz leicht kürzen lässt. Der integrierte Akku des Halsbandes ist bequem per USB-Kabel, zum Beispiel am Computer, aufladbar. Batterien sind somit nicht mehr nötig. \r\n\r\n Top-Neuheit des Jahres \r\n\r\nVon den Lesern einer renommierten Fachzeitschrift wurde das CE-geprüfte Visio Light Halsband in der Kategorie Hund sogar zur Top-Neuheit 2012/2013 gewählt – und wen wundert\'s?  Wem an der Sicherheit seines vierbeinigen Familienmitglieds gelegen ist, erkennt sofort den Wert des Visio Lights.'),(427,4,83,0,85,NULL),(428,4,106,0,85,NULL),(429,4,146,0,85,'0'),(430,4,72,0,86,NULL),(431,4,73,0,86,'Sicherheit im Dunkeln!\r\n- Im praktischen Vorteilspack (3 Stück)\r\n- Sofort einsatzbereit\r\n- LED Sicherheitsblinker\r\n- Sichtbar bis 500m\r\n- Batterien bis zu ca.100 Stunden Blinklicht\r\n- Inkl. Ersatzbatterien (LR41X3)\r\n- Wasserfest\r\n- Schnelle Anbringung durch Karabinerhaken'),(432,4,83,0,86,NULL),(433,4,106,0,86,NULL),(434,4,146,0,86,'0'),(435,4,72,0,87,NULL),(436,4,73,0,87,'Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. \r\n• Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen.\r\n\r\nEmpfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise daran gewöhnen. Da die Vorder- und Hinterpfoten eines Hundes unterschiedlich groß sein können, werden die Schuhe paarweise geliefert. Denken Sie daran, wenn Sie die Größe feststellen. \r\n\r\nKomforttest: Für den optimalen Komfort muss nach dem Schließen des Klettverschlusses ein Fingerbreit Platz bleiben. Xtreme Boots sind für die Benutzung im Freien gedacht. Bitte behalten Sie Ihr Haustier im Auge.'),(437,4,83,0,87,NULL),(438,4,106,0,87,NULL),(439,4,146,0,87,'0'),(440,4,72,0,88,NULL),(441,4,73,0,88,'Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. \r\n• Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen.\r\n\r\nEmpfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise daran gewöhnen. Da die Vorder- und Hinterpfoten eines Hundes unterschiedlich groß sein können, werden die Schuhe paarweise geliefert. Denken Sie daran, wenn Sie die Größe feststellen. \r\n\r\nKomforttest: Für den optimalen Komfort muss nach dem Schließen des Klettverschlusses ein Fingerbreit Platz bleiben. Xtreme Boots sind für die Benutzung im Freien gedacht. Bitte behalten Sie Ihr Haustier im Auge.'),(442,4,83,0,88,NULL),(443,4,106,0,88,NULL),(444,4,146,0,88,'0'),(445,4,72,0,89,NULL),(446,4,73,0,89,'Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. \r\n• Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen.\r\n\r\nEmpfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise 