est - Flexibel - Einfache Reinigung - Spülmaschinenfest|4.99|1'),(483,53,1,'44139|FUTTERBOX FÜR UNTERWEGS FÜR SNACKS + WASSER 12CM X 16CM||Praktisches dreiteiliges Reise-Set für: • längere Autofahrten • Fahrradtouren • Wanderungen Das Set besteht aus: • durchsichtigem Futterbehälter mit Schraubverschluss und Griff • zwei Kunststoffnäpfen für Futter und Wasser Platzsparend können diese drei Teile ineinander gesteckt und mit einem Griff getragen werden. Fassungsvermögen ca.: Futterbehälter 1600 ml, Näpfe je 600 ml.|9.99|1'),(484,54,1,'68128|SNACK DUMMY TEFLON® 22 X 7CM, SCHWARZ/ROT||Snack Dummy No Limit - Apportieren leicht gemacht! Durch die Beschichtung mit original Teflon® ist diese Tasche unempfindlich gegen Nässe und Schmutz. Sie kann mit Snacks oder Trockenfutter befüllt werden und eignet sich ideal für die Erziehung und Ausbildung. Der Hund wird positiv motiviert, wenn er nach erfolgreichem Bringen sein Leckerchen aus der Tasche erhält. Es gibt keine Verletzungsgefahr, da der Reißverschluss verdeckt eingearbeitet ist. Die Tasche ist abwaschbar. Teflon® ist eine Marke von DuPont, die unter Lizenz von KARLIE Heimtierbedarf GmbH genutzt wird.|10.99|1'),(485,55,1,'511969|NAPF BELLA AUS EDELSTAHL SCHWARZ||Mit Anti-Rutsch-Gummiring (abnehmbar). Pflegeleicht. Farbe: schwarz.|5.99|1'),(486,56,1,'511971|NAPF BELLA AUS EDELSTAHL SCHWARZ||Mit Anti-Rutsch-Gummiring (abnehmbar). Pflegeleicht. Farbe: schwarz.|3.99|1'),(487,57,1,'44100|NORTHMATE ® GREEN MINI 29X22,5X7CM GRÜN||Euer Hund schlingt seine Mahlzeiten in wenigen Sekunden herunter? Mit dem neuen interaktiven Fressnapf GREEN by NORTHMATE ® frisst euer Hund deutlich langsamer und hat auch noch Spaß dabei! Der Fressnapf ist einem Grasbüschel nachempfunden und verwandelt jede Mahlzeit in ein herausforderndes Spiel. GREEN by NORTHMATE ® besteht aus Hartkunststoff (ohne Phthalate) und kann somit auch im Freien genutzt – und im Geschirrspüler gereinigt werden. Zur Nass- und Trockenfütterung geeignet. GREEN by NORTHMATE ® gibt es auch für größere Hunde!|24.99|1'),(488,58,1,'44079|NORTHMATE ® GREEN 40X30X10CM GRÜN||Euer Hund schlingt seine Mahlzeiten in wenigen Sekunden herunter? Mit dem neuen interaktiven Fressnapf GREEN by NORTHMATE ® frisst euer Hund deutlich langsamer und hat auch noch Spaß dabei! Der Fressnapf ist einem Grasbüschel nachempfunden und verwandelt jede Mahlzeit in ein herausforderndes Spiel. GREEN by NORTHMATE ® besteht aus Hartkunststoff (ohne Phthalate) und kann somit auch im Freien genutzt – und im Geschirrspüler gereinigt werden. Zur Nass- und Trockenfütterung geeignet. GREEN by NORTHMATE ® gibt es jetzt auch im Mini-Format, für kleine Hunde!|39.9|1'),(489,59,1,'45190|BAUMWOLLKNOTEN ZUR ZAHNPFLEGE, CA. 20 CM BUNT||Bestens geeignet für Zieh- und Zerrspiele ist dieses bunte, stabile Baumwolltau mit Knoten. Beim Spielen werden auch gleichzeitig die Zähne gepflegt.|1.59|1'),(490,60,1,'45310|NYLON FRISBEE 24 CM NEONFARBEN||Das Spiel mit Frisbees ist eine aktionsreiche und aufregende Freizeitbeschäftigung für bewegungsfreudige Hunde und deren genauso sportliche Herrchen. Neben Distanzwürfen gibt es unzählige Wurftechniken, die das Spiel immer wieder abwechslungsreich gestalten. Frisbee spielen kann man eigentlich mit jedem Hund. Der Hund sollte allerdings ausgewachsen und gesund sein. Diese Frisbee Scheibe besteht aus neonfarbigem Nylon und ist schön leicht.|3.99|1'),(491,61,1,'45439|AQUA ACTIONBALL SCHWARZ/GELB, 13 CM||Für schwimmbegeisterte Vierbeiner! Das ideale Wasserspielzeug aus softweichem, hochwertigem Neopren. Der Aquaball ist schwimmfähig und gut zu greifen durch die Baumwollseile. Die schwarz-gelbe Farbe ist im Wasser gut zu sehen. Und ist der Ball mal schmutzig, kann er bei 30 °C gewaschen werden.|9.99|1'),(492,62,1,'45855|BOOMER AQUA FOOTBALL, VOLLG. 9 CM,SCHWIMMEND BOOMER, ORANGE||Mit dem Boomer Vollgummi Aqua Football bieten Sie Ihrem Hund stundenlangen Spielspaß im und am Wasser. Mit Hilfe der Kordel lässt sich der Football super werfen. Der Ball ist schwimmfähig und die Farbe orange ist im Wasser besonders gut sichtbar. Ideal zum Apportieren, Trainieren und Ausbilden. Massiert und pflegt \"spielend\" Gebiss und Zähne. Mit Vanille-Aroma.|8.99|1'),(493,63,1,'45859|BOOMER AQUA RING, VOLLGUMMI 15 CM, SCHWIMMEND BOOMER, ORANGE||Für besonders viel Spaß am und im Wasser sorgt der schwimmfähige Boomer Aqua Ring aus natürlichem Vollgummi. Nebenbei werden Gebiss und Zähne \"spielend\" massiert und gepflegt. Ideal auch zum Apportieren, Trainieren und Ausbilden. Durch die orange Farbe besonders gut sichtbar im Wasser. Mit Vanille-Aroma.|11.99|1'),(494,64,1,'45906|MOOSGUMMIBALL 9 CM SCHWARZ/WEISS||Bieten Sie Ihrem Hund Abwechslung und Bewegung mit diesem Spielzeug. Kleiner weicher Fußball aus Moosgummi in schwarz-weiß.|6.49|1'),(495,65,1,'64905|SOFT FRISBEE GELB DURCHMESSER 22CM||Soft-Kunststoff. Schnell und einfach vom Boden zu fassen! Tolle Flugweiten. Ideal auch für Welpen.|9.99|1'),(496,66,1,'47022|HOCHFREQUENZ HUNDEPFEIFE REICHWEITE BIS 450 M||Pfeifen unterstützen ein neutrales Training, da Emotionen nicht über eine Pfeife übertragen werden. Metallpfeifen gibt es in verschiedenen Ausführungen: als Hochfrequenzpfeife oder Trillerpfeife. In der Ausbildung von Hunden sehr beliebt sind Hochfrequenzpfeifen. Für den Hund sind hohe Frequenzen wesentlich besser zu hören als für den Menschen. Auch ist ein Ton aus dieser Pfeife immer ein eindeutiges Signal, anders als bei einer Stimme, die immer wieder anders klingt. Ein weiterer Vorteil für den Einsatz dieser Pfeife besteht darin, dass die Umgebung nur wenig gestört wird. Die Frequenz ist einstellbar. Robuste Metallausführung.|4.99|1'),(497,67,1,'47021|HOCHFREQUENZ HUNDEPFEIFE REICHWEITE BIS 200 M||Pfeifen unterstützen ein neutrales Training, da Emotionen nicht über eine Pfeife übertragen werden. Metallpfeifen gibt es in verschiedenen Ausführungen: als Hochfrequenzpfeife oder Trillerpfeife. In der Ausbildung von Hunden sehr beliebt sind Hochfrequenzpfeifen. Für den Hund sind hohe F