ert sich der Tierhilfe Montenegro e.V. für ein besseres Leben der dort lebenden Tiere. Karlie Flamingo schätzt die tägliche Arbeit des Vereins sehr und hilft unter anderem mit Sachspenden mit, das Leben der Hunde und Katzen lebenswerter zu machen. Um vor allem eine nachhaltige Hilfe vor Ort zu gewährleisten, wurde in Kooperation mit der Zeitschrift „Ein Herz für Tiere“ die eigens produzierte „Montenegro-Kollektion“ von Karlie Flamingo, bestehend aus Halsbändern, Betten, Kissen und Näpfen, kreiert. Von jedem verkauften Artikel der Kollektion kommt ein Euro dem Verein und der von ihm betreuten Tiere zugute. Zusätzlich erhält jeder Abonnent von „Ein Herz für Tiere“ als Prämie ein Hundehalsband aus der farbenfrohen Kollektion.|129|1'),(515,85,1,'64904|VISIO LIGHT LED SCHLAUCHHALSBAND 70CM ORANGE||- Sichtbar bis ca. 500m - Aufladbarer Akku über USB-Kabel (z.B. am Computer) - Keine Batterien mehr nötig - Schlauch besteht aus flexiblem, weichem Silikon - Wasserfest - Temperaturbeständig - Blink- und Dauerlicht einstellbar - Leuchtdauer bei Blinklicht beträgt ca. 2 Stunden, bei Dauerlicht ca. 1,5 Stunden - Universell kürzbar, Einheitsgröße - Für Halsweiten von 20-75cm geeignet - CE geprüft - Mit USB-Kabel - Ladezeit beträgt ca. 1,5 bis 2 Stunden - Erhältlich in den Farben Orange, Grün, Weiß und Schwarz Bringt Licht ins Dunkel – Mit dem prämierten Karlie Flamingo Visio Light LED-Halsband kann der fürsorgliche Hundebesitzer beim Gassi gehen nun effektiv für die Sicherheit seines geliebten Vierbeiners sorgen. Das neue LED-Halsband sorgt nämlich in drei unterschiedlichen Einstellungen zwischen Blink- und Dauerlicht dafür, dass der beste Freund des Menschen auf bis zu 500 Meter nicht mehr zu übersehen ist. Bunt wie der Herbst Das Halsband ist für Hunde äußerst angenehm zu tragen, da der Schlauch, im Gegensatz zu vielen anderen Leuchthalsbändern, nicht aus Gummi, sondern aus flexiblem und weichem Silikon besteht. Dieses ist zudem wasserfest und äußerst temperaturbeständig und somit auch für Spaziergänge bei regnerischem Herbstwetter optimal geeignet. Passend zur Farbvielfalt des Herbstes ist das Visio Light in frischem Orange und seit neuestem auch in den Farben Grün, Weiß und Schwarz erhältlich. Universell kürzbar für alle Hundegrößen Besonders praktisch: Das Visio Light gibt es in einer Einheitsgröße und ist dabei für alle Halsweiten von 20 bis 75 Zentimeter geeignet, da es sich ganz leicht kürzen lässt. Der integrierte Akku des Halsbandes ist bequem per USB-Kabel, zum Beispiel am Computer, aufladbar. Batterien sind somit nicht mehr nötig. Top-Neuheit des Jahres Von den Lesern einer renommierten Fachzeitschrift wurde das CE-geprüfte Visio Light Halsband in der Kategorie Hund sogar zur Top-Neuheit 2012/2013 gewählt – und wen wundert\'s? Wem an der Sicherheit seines vierbeinigen Familienmitglieds gelegen ist, erkennt sofort den Wert des Visio Lights.|9.99|1'),(516,86,1,'64900|BLINKY HERZ FARBLICH SORTIERT PINK, WEIß, HELLBLAU||Sicherheit im Dunkeln! - Im praktischen Vorteilspack (3 Stück) - Sofort einsatzbereit - LED Sicherheitsblinker - Sichtbar bis 500m - Batterien bis zu ca.100 Stunden Blinklicht - Inkl. Ersatzbatterien (LR41X3) - Wasserfest - Schnelle Anbringung durch Karabinerhaken|4.99|1'),(517,87,1,'11083|XTREME BOOTS 2ER SET XXS, SCHWARZ||Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. • Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen. Empfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise daran gewöhnen. Da die Vorder- und Hinterpfoten eines Hundes unterschiedlich groß sein können, werden die Schuhe paarweise geliefert. Denken Sie daran, wenn Sie die Größe feststellen. Komforttest: Für den optimalen Komfort muss nach dem Schließen des Klettverschlusses ein Fingerbreit Platz bleiben. Xtreme Boots sind für die Benutzung im Freien gedacht. Bitte behalten Sie Ihr Haustier im Auge.|16.99|1'),(518,88,1,'11084|XTREME BOOTS 2ER SET XS, SCHWARZ||Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. • Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen. Empfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise daran gewöhnen. Da die Vorder- und Hinterpfoten eines Hundes unterschiedlich groß sein können, werden die Schuhe paarweise geliefert. Denken Sie daran, wenn Sie die Größe feststellen. Komforttest: Für den optimalen Komfort muss nach dem Schließen des Klettverschlusses ein Fingerbreit Platz bleiben. Xtreme Boots sind für die Benutzung im Freien gedacht. Bitte behalten Sie Ihr Haustier im Auge.|17.99|1'),(519,89,1,'11085|XTREME BOOTS 2ER SET S, SCHWARZ||Bieten komfortablen Schutz für die Pfoten während der Wintermonate, sind jedoch auch gut für Bergwanderungen oder einen bequemen Gang im Alltag geeignet. • Bequem an- und auszuziehen • Guter Sitz und Halt • Doppel-Klettverschluss • Langlebige Gummisohle für zusätzlichen Halt • Zweier-Set • Bietet optimalen Schutz vor Kälte, Salz und spitzen Steinen. Empfehlung: Vielleicht ist es eine ganz neue Erfahrung für Ihren Hund, Xtreme Boots zu tragen. Deshalb empfehlen wir, Ihrem Hund nicht sofort alle Schuhe anzuziehen, sondern mit einer Vorderpfote zu beginnen. So kann sich Ihr Hund schrittweise daran 